import logo from "./logo.svg";
import "./App.css";

function App() {
  const age = 2;
  return (
    <div style = {{ fontSize : age > 10 ? "40px" : "20px" , color : age > 10 ? "green" : ""}}>
      {age > 10 ? <h1>over</h1> : <h1>under</h1>}
      {age === 10 && <h1>your age is 10</h1>}
      <button className={age > 10 ? "over" : "under"}>click me</button>
    </div>
  );
}

export default App;
